import axios from 'axios'
import React, { useEffect } from 'react'

const ProudPartner = () => {

    const getPartner = () => {
        axios.get("http://34.254.97.212:8080/api/partners/allpartner").then((res)=>{
            console.log("list", res);
        })
    }

    // useEffect(() => {
    //     axios.get("http://34.254.97.212:8080/api/partners/allpartner").then((res)=>{
    //         console.log("list", res);
    //     })
    // }, []);

    useEffect (() => {
        // alert('wake up ')
        async function getData(){
            const res = await axios.get('http://34.254.97.212:8080/api/partners/allpartner');
            console.log(res);
        }
        getData();
    },);

  return (
    <div className='proud_partner'>
        <div className="container">
            <h1 className='headin-2'>Proud Partner Organizations</h1>
            <ul className='client-logo'>
                <li>
                    <a href="/">
                        <img className='img-fluid' src="../../images/abbra_home_logo.png" alt="" /> 
                    </a>

                </li>
                <li>
                    <a href="/">
                        <img className='img-fluid' src="../../images/iyris-main-logo.png" alt="" />
                    </a>
                </li>
                <li>
                    <a href="/">
                        <img className='img-fluid' src="../../images/maine_island_trail_logo.png" alt="" />
                    </a>
                </li>
                <li>
                    <a href="/">
                        <img className='img-fluid' src="../../images/MIDALogo.svg" alt="" />
                    </a>
                </li>
                <li>
                    <a href="/">
                        <img className='img-fluid' src="../../images/boater-input-logo.png" alt="" />
                    </a>
                </li>
                <li>
                <a href="/">
                        <img className='img-fluid' src="../../images/boathowto-logo.jpeg" alt="" />

                    </a>
                </li>
            </ul>
        </div>
    </div>
  )
}

export default ProudPartner
